import string


def ProcessLoading(sg, access="ProcessLoading"):
    red_dots_ring = b''
    blue_dots = b''



    for i in range(1):
        if not sg.popup_animated(sg.DEFAULT_BASE64_LOADING_GIF, message='Right Click To Exit GIF Windows That Follow\nLeft click to move to next one', no_titlebar=False, time_between_frames=100, text_color='black', background_color='white'):
            break
    sg.popup_animated(None)   
    layout = [
            [sg.Text("-- Process Loading --", font="Times")],
            [sg.Image(data=red_dots_ring, enable_events=True, background_color='white', key='-IMAGE-', right_click_menu=['UNUSED', ['Exit']], pad=0)],]
    gifs = [red_dots_ring]

    window = sg.Window('My new window', layout,
            no_titlebar=True,
            grab_anywhere=True,
            keep_on_top=True,
            background_color='white',
            # transparent_color='white' if sg.running_windows() else None,
            alpha_channel=0.9,
            margins=(0,0), element_justification="c")

    gif = gifs[0]
    count = 0
    while True:                                     # Event Loop
        event, _ = window.read(timeout=10)     # loop every 10 ms to show that the 100 ms value below is used for animation
        if event in (sg.WIN_CLOSED, 'Exit', 'Cancel'):
            break
        if mySleep(count, access):
            break
        count += 1
        
        window['-IMAGE-'].update_animation(gif,  time_between_frames=100)
    return True, window

def mySleep(num, access="ProcessLoading"):
    if access == "Problem":
        if num == 300:
            return True
        return False

    elif access != "ProcessLoading":
        if num == 300:
            return True
        return False
    else:
        if num == 850:
            return True
        return False

